import React from "react";
import {Navbar, NavbarBrand } from "reactstrap";



export default props => {
  return (
      <div>
      <Navbar className="nav-head">
        <NavbarBrand
          className="nav-brand" style={{color:"red"}}
          onClick={_ => {
            props.setPage(0);
          }}
        >
         Book My Table
        </NavbarBrand>
      </Navbar>
      </div>
  );
};
